const ROUTES = {
    ROOT: '/',
    HOME: '/home',
    DASHBOARD: '/dashboard',
    START: '/start',
    REPORT: '/start/report',
    MORE: '/more',
    PHONE_POPUP: '/phone-popup',
    ABOUT: '/about', // Add the route for the "AboutPage"
    CONTACT_US: '/contact-us', // Add the route for the "ContactUsPage"
};

export default ROUTES;
